- Name: azure-cosmos-spark_3-3_2-12
  Version: 4.33.0
  DisplayName: OLTP Spark 3.3 Connector for Azure Cosmos DB SQL API
  ServiceName: OLTP Spark 3.3 Connector
  VersionType: GA
  Hidden: false
  ChangelogUrl: https://github.com/Azure/azure-sdk-for-java/tree/azure-cosmos-spark_3-3_2-12_4.33.0/sdk/cosmos/azure-cosmos-spark_3-3_2-12/CHANGELOG.md
  ChangelogContent: |-
    #### Bugs Fixed
    * Fixed a race condition resulting in not always re-enqueueing retries for bulk writes. - See [PR 40714](https://github.com/Azure/azure-sdk-for-java/pull/40714)

    #### Features Added
    * Added a service trait `CosmosClinetBuilderInterceptor` to allow intercepting and customizing the CosmosClient creation. - See [PR 40714](https://github.com/Azure/azure-sdk-for-java/pull/40714)
  GroupId: com.azure.cosmos.spark
